import React, { useState } from 'react';
import './App.css';
import { TextEditor } from './components/TextEditor';
import { StatsPanel } from './components/StatsPanel';
import { SelfContainedExport } from './components/SelfContainedExport';
import { FileVerification } from './components/FileVerification';

function App() {
  const [view, setView] = useState('editor'); // 'editor' or 'verify'
  const [documentId, setDocumentId] = useState(null);
  const [certificate, setCertificate] = useState(null);
  const [currentContent, setCurrentContent] = useState('');
  const [stats, setStats] = useState({
    wordCount: 0,
    charCount: 0,
    versionCount: 0,
    typingStats: {
      totalKeystrokes: 0,
      averageTypingSpeed: 0,
      totalTimeSpent: 0,
      pauseCount: 0,
      backspaceCount: 0,
      copyPasteDetected: false,
    },
  });

  const handleStatsChange = (newStats) => {
    setStats(newStats);
  };

  const handleContentChange = (content) => {
    setCurrentContent(content);
  };

  // Check URL for verification link on load
  useEffect(() => {
    const params = new URLSearchParams(window.location.search);
    const verifyCertId = params.get('verify');
    if (verifyCertId) {
      setView('verify');
    }
  }, []);

  const handleExport = async () => {
    try {
      // Create document if not exists
      let docId = documentId;
      if (!docId) {
        const doc = await documentAPI.create({
          title: 'Untitled Document',
          content: '', // This will be updated with actual content
          authorId: 'user_' + Date.now(),
          keystrokes: [],
          versions: [],
          typingStats: stats.typingStats,
        });
        docId = doc.id;
        setDocumentId(docId);
      }

      // Sign document
      await documentAPI.sign(docId);

      // Generate certificate
      const cert = await documentAPI.generateCertificate(docId);
      setCertificate(cert);

      // Download certificate as JSON
      const certData = JSON.stringify(cert, null, 2);
      const blob = new Blob([certData], { type: 'application/json' });
      const url = URL.createObjectURL(blob);
      const link = document.createElement('a');
      link.href = url;
      link.download = `certificate-${cert.id}.json`;
      link.click();
      URL.revokeObjectURL(url);

      alert(`Certificate generated successfully!\nCertificate ID: ${cert.id}\n\nThe certificate has been downloaded. Anyone can verify this document using the Certificate ID on the verification portal.`);
    } catch (error) {
      console.error('Export error:', error);
      alert('Failed to generate certificate. Please make sure the backend server is running.');
    }
  };

  const handleVerify = () => {
    setView('verify');
  };

  const handleBackToEditor = () => {
    setView('editor');
  };

  if (view === 'verify') {
    return (
      <div className="app">
        <header className="header">
          <div className="logo">Verified Editor</div>
          <div className="header-actions">
            <button className="btn btn-secondary" onClick={handleBackToEditor}>
              Back to Editor
            </button>
          </div>
        </header>
        <VerificationPortal />
      </div>
    );
  }

  return (
    <div className="app">
      <header className="header">
        <div className="logo">Verified Editor</div>
        <div className="header-actions">
          <button className="btn btn-secondary" onClick={handleVerify}>
            Verify Document
          </button>
          <button className="btn btn-primary" onClick={handleExport}>
            Export Certificate
          </button>
        </div>
      </header>

      <main className="main-container">
        <section className="editor-section">
          <TextEditor
            onStatsChange={handleStatsChange}
            onContentChange={handleContentChange}
          />
          {certificate && (
            <SubmissionPackage
              certificate={certificate}
              content={currentContent}
              stats={stats}
            />
          )}
        </section>

        <aside className="sidebar">
          <StatsPanel
            wordCount={stats.wordCount}
            charCount={stats.charCount}
            versionCount={stats.versionCount}
            typingSpeed={stats.typingStats.averageTypingSpeed}
            totalTime={stats.typingStats.totalTimeSpent}
            copyPasteDetected={stats.typingStats.copyPasteDetected}
          />
          <ActivityFeed />
          {certificate && (
            <div className="info-card">
              <h3 className="info-card-title">Latest Certificate</h3>
              <div className="detail-item">
                <span className="stat-label">Certificate ID</span>
                <span className="stat-value" style={{ fontSize: '11px', wordBreak: 'break-all' }}>
                  {certificate.id}
                </span>
              </div>
            </div>
          )}
        </aside>
      </main>
    </div>
  );
}

export default App;
